INSERT INTO public.surveys VALUES (1, 'Sample one-question survey', 1, '{"pages": [{"title": "Sharing Cities - Product Survey", "questions": [{"name": "satisfaction", "type": "rating", "title": "How satisfied are you with the Product?", "maximumRateDescription": "Perfect", "mininumRateDescription": "Unsatisfied"}], "showProgressBar": "top"}]}', '2017-12-07 00:00:00', '2017-12-07 00:00:00');
INSERT INTO public.surveys VALUES (2, 'Sample multi-page survey', 2, '{"pages": [{"name": "page1", "elements": [{"name": "satisfaction", "type": "rating", "title": {"sv": "Hur ligger vi till?", "default": "How satisfied are you with the Product?"}, "maxRateDescription": {"sv": "Toppen", "default": "Completely satisfied"}, "minRateDescription": {"sv": "Botten", "default": "Not Satisfied"}}, {"name": "satisfaction_followup", "type": "radiogroup", "title": {"sv": "Så vi är på rätt väg?"}, "choices": [{"text": {"sv": "Jajamensan!"}, "value": "yes"}, {"text": {"sv": "Vi får väl se..."}, "value": "maybe"}], "visible": false, "visibleIf": "{satisfaction} > 3"}]}, {"name": "page2", "elements": [{"name": "personal", "type": "panel", "title": {"sv": "Lite om dig"}, "elements": [{"name": "visited_places", "type": "checkbox", "title": {"sv": "Reser du regelbundet till någon/några av dessa platser?"}, "choices": [{"text": {"sv": "Danmark"}, "value": "denmark"}, {"text": {"sv": "Något annat EU-land"}, "value": "other_eu_country"}, {"text": {"sv": "Utanför Europa"}, "value": "outside_europe"}]}, {"name": "favorite_color", "type": "text", "title": {"sv": "Vilken är din favoritfärg?"}, "inputType": "color"}, {"name": "try_new_things", "type": "radiogroup", "title": {"sv": "Hur intresserad är du av att pröva nya saker?", "default": "How interested are you in trying new things?"}, "choices": ["Vill helst ha det som vanligt", "Beror på vad det är", "Aldrig samma sak två gånger!"]}]}]}, {"name": "page3", "elements": [{"name": "planning", "type": "panel", "title": {"sv": "Planering"}, "elements": [{"name": "prioritized_activity", "rows": [{"text": "Vad är viktigast under finansiseringsfasen?", "value": "funding"}, {"text": "Vad är viktigast för en förstudie?", "value": "study"}, {"text": "Vad är viktigast vid prototyputveckling?", "value": "prototyp"}], "type": "matrix", "title": "Välj högst prioriterade aktivitet", "columns": [{"text": "Överdrifter", "value": 1}, {"text": "Fusk", "value": 2}, {"text": "Personalfest", "value": 3}]}]}]}, {"name": "page4", "elements": [{"name": "exit", "type": "panel", "title": {"sv": "Uppföljning"}, "elements": [{"name": "comments", "type": "comment", "title": {"sv": "Finns det något du skulle vilja tillägga?"}}, {"name": "want_followup", "type": "radiogroup", "title": {"sv": "Hur vill du skicka in dina svar?"}, "choices": [{"text": {"sv": "ange din unika pseudonym"}, "value": true}, {"text": {"sv": "anonymt"}, "value": false}], "isRequired": true}, {"name": "pseudonym", "type": "text", "title": {"sv": "Ange din pseudonym"}, "visible": false, "visibleIf": "{want_followup} = true", "isRequired": true, "placeHolder": {"sv": "Ange din pseudonym"}, "defaultValue": "anonymous", "startWithNewLine": false}]}]}], "title": "Testenkät juli 2018", "locale": "sv", "showProgressBar": "top"}', '2017-12-07 00:00:00', '2017-12-07 00:00:00');
INSERT INTO public.surveys VALUES (3, 'Viable template', 3, '{"pages": [{"name": "administrative", "title": {"sv": "Administrativt"}, "elements": [{"name": "followup_period", "type": "text", "title": {"sv": "Uppföljningsperiod"}, "defaultValue": "Augusti 2018"}, {"name": "project_id", "type": "text", "title": {"sv": "Projekt-ID"}, "isRequired": true}, {"name": "pm_name", "type": "text", "title": {"sv": "Namn projektledare"}, "isRequired": true}, {"name": "pm_email", "type": "text", "title": {"sv": "E-post projektledare"}, "inputType": "email", "isRequired": true, "placeHolder": {"sv": "namn@webbsajt.se"}}]}, {"name": "project_info", "title": {"sv": "Projektinformation\n"}, "elements": [{"name": "project_title", "type": "text", "title": {"sv": "Projektnamn"}, "isRequired": true}, {"name": "project_organization", "type": "text", "title": {"sv": "Organisation"}, "isRequired": true}, {"name": "keywords", "type": "comment", "title": {"sv": "Nyckelord"}}]}, {"name": "funding", "title": {"sv": "Finansiering"}, "elements": [{"name": "budget", "type": "multipletext", "items": [{"name": "funded", "title": "Sökt stöd", "inputType": "number"}, {"name": "total_cost", "title": {"sv": "Totalkostnad"}, "inputType": "number"}], "title": {"sv": "Budget"}, "isRequired": true, "startWithNewLine": false}, {"name": "ratio_funded", "type": "expression", "title": "Andel sökt stöd:", "expression": "{budget.funded} / {budget.total_cost}", "displayStyle": "percent", "startWithNewLine": false}, {"name": "other_financiers", "type": "comment", "title": {"sv": "Övriga finansiärer"}}, {"name": "other_recipients", "type": "comment", "title": {"sv": "Övriga mottagare"}}]}, {"name": "focus_areas", "title": {"sv": "Fokusområden"}, "elements": [{"name": "focus_areas", "type": "checkbox", "title": {"sv": "Ange relevanta fokusområden (ett eller flera)"}, "choices": [{"text": {"sv": "Livsstil och konsumtion"}, "value": "lifestyle"}, {"text": {"sv": "Planering och byggd miljö"}, "value": "planning"}, {"tex